import React, { useState } from "react";
const App = () => {

  return (
    <>
      <table>
        <tr>
          <th>Name</th>
          <th>Age</th>
          <th>Email</th>
        </tr>
        <tr>
          <td>Alfreds Futterkiste</td>
          <td>Maria Anders</td>
          <td>Germany</td>
        </tr>

      </table>
    </>
  );
};

export default App;
